webpackJsonp([0x834755aae49e],{454:function(t,e){t.exports={data:{markdownRemark:{html:'<p>こんにちは。<br>\nこのサイトは静的サイトジェネレーター "Gatsby JS" で作成されました。  </p>\n<p>React を使った SPA サイトが簡単につくれます。<br>\n<a href="https://www.gatsbyjs.org/">https://www.gatsbyjs.org/</a>  </p>\n<p>ということなのですが，<br>\n言われているほど簡単かどうかは分かりません。<br>\n開発環境構築にちょいちょい躓きました。<br>\nWeb Fornt 関係に慣れていない方にとっては<br>\nそこまで易しくないかもしれません。  </p>\n<p>とはいえ，いったんフローが確立できれば確かに便利です。<br>\nLiveReload で変更を随時確認しながら開発ができたりします。<br>\n（最近の Web開発はみんなそうなのかもしれないけど）\nDB使わないのでインフラ周りがシンプルなのもいいですね。<br>\n静的なファイルだけなので git などでバージョン管理しておけば<br>\n任意の時点へ戻すことも簡単です。  </p>\n<p>便利なサービスがたくさんあっていい時代です。</p>\n<p>感謝。</p>',timeToRead:1,excerpt:'こんにちは。 このサイトは静的サイトジェネレーター "Gatsby JS" で作成されました。   React を使った SPA サイトが簡単につくれます。 https://www.gatsbyjs.org…',frontmatter:{title:"Hello world",cover:"https://unsplash.it/400/300/?random?TheFallenTime",date:"2018-04-03",category:"website",tags:["react"]},fields:{nextTitle:null,nextSlug:null,prevTitle:null,prevSlug:null,slug:"/hello-world"}}},pathContext:{slug:"/hello-world"}}}});
